import React from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Home from "./components/Home";
import Team from "./components/Team"
import Prediction from "./components/Prediction";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Ticket from "./components/Ticket";
import Statistics from "./components/Statistics";
import CustomModel from "./components/CustomModel";
import Admin from "./components/Admin";
import JiraScripts from "./components/JiraScripts";
import ImsScripts from "./components/ImsScripts";
import CreateAS from "./components/CreateAS";
import AdcuStatistics from "./components/AdcuStatistics";
import history from "./history";
import CleanUpHelper from "./components/CleanUpHelper";
import WallOfFame from "./components/WallOfFame";
import WallOfFameIMS from "./components/WallOfFameIMS";
import CreateEpicsHA22 from "./components/CreateEpicsHA22";
import TransitionFromAnalyzerToAccepted from "./components/TransitionFromAnalyzerToAccepted"
import CreateSS from "./components/CreateSS";
import FolderStructure from "./components/FolderStructure";
import NamingConventions from "./components/NamingConventions";


function App() {
  return (
    <React.Fragment>
      <Router history={history}>
        <Switch>
          <Route exact path="/" render={() => <Home cisco={false} />} />
          <Route
            exact
            path="/prediction/"
            render={() => <Prediction mesaj={"salut"} />}
          />
          <Route exact path="/ticket" component={Ticket} />
          <Route exact path="/statistics" component={Statistics} />
          <Route exact path="/custom/model" component={CustomModel} />
          <Route exact path="/admin" component={Admin} />
          <Route exact path="/jirascripts" component={JiraScripts} />
          <Route exact path="/imsscripts" component={ImsScripts} />
          <Route exact path="/jirascripts/create-analysis" component={CreateAS} />
          <Route exact path="/jirascripts/sw2_statistics" component={AdcuStatistics} />
          <Route exact path="/jirascripts/create-stories-and-subtasks" component={CreateSS} />
          <Route exact path="/jirascripts/clean-up" component={CleanUpHelper} />
          <Route exact path="/jirascripts/walloffame" component={WallOfFame} />
          <Route exact path="/imsscripts/walloffameims" component={WallOfFameIMS} />
          <Route exact path="/jirascripts/script2" component={CreateEpicsHA22} />
          <Route exact path="/jirascripts/epicinanalyzed" component={TransitionFromAnalyzerToAccepted} />
          <Route exact path="/imsscripts/naming-conventions" component={NamingConventions} />
          <Route exact path="/imsscripts/folder-structure" component={FolderStructure} />
 	        <Route exact path="/team" component={Team} />
        </Switch>
      </Router>
    </React.Fragment>
  );
}

export default App;
